import React, { useState, useRef } from 'react';
import { SafeAreaView, Text, TextInput, View, Image, ScrollView, TouchableOpacity } from "react-native";
import InputContrl from '../../Components/InputContrl';
import { Colors } from '../../Utils/Color';
import { styles } from './styles';
import Header from '../../Components/Header';
import DateIcon from '../../Icons/DateIcon';
import CheckBox from '@react-native-community/checkbox';
import ButtonContrl from '../../Components/ButtonContrl';
import { createProduct } from '../../Utils/firebase';
import { launchCamera, launchImageLibrary } from 'react-native-image-picker';
import { storage } from '../../Utils/firebase-Config';
import RNFS from 'react-native-fs';

export default AdminAddProducts = ({ navigation }) => {
    const [uri, setUri] = useState({
        img: "file:///data/user/0/com.smartshop/cache/rn_image_picker_lib_temp_0c8e6c69-4375-4ddc-b768-17b122287765.jpg",
    });
    const image = useRef({
        img: "data:image/jpeg;base64,"
    });
    const [product, setProduct] = useState({
        name: "",
        quantity: "",
        display: "",
        os: "",
        cameraS: "",
        cameraT: "",
        chip: "",
        ram: "",
        rom: "",
        sim: "",
        pin: "",
        price: "",
        firm: "",
    })
    const createPr = () => {
        createProduct({ ...product, ...image.current })
        setProduct({
            name: "",
            quantity: "",
            display: "",
            os: "",
            cameraS: "",
            cameraT: "",
            chip: "",
            ram: "",
            rom: "",
            sim: "",
            pin: "",
            price: "",
            firm: "",
        })
    }

    const selectImage1 = async () => {
        const options = {
            maxWidth: 2000,
            maxHeight: 2000,
            storageOptions: {
                skipBackup: true,
                path: 'images'
            }
        };
        launchImageLibrary(options, response => {
            if (response.didCancel) {
                alert('User cancelled image picker');
            } else if (response.error) {
                alert('ImagePicker Error: ', response.error);
            } else if (response.customButton) {
                alert('User tapped custom button: ', response.customButton);
            } else {
                setUri({ ...uri, img: response.assets[0].uri });
                image.current = { ...image.current, img: response.assets[0].uri }
                if (response.assets[0].uri != null) {
                    convertBase64()
                }
            }
        })
    }
    const convertBase64 = async () => {
        var data = await RNFS.readFile(image.current.img, 'base64')
            .then(res => { return res });
        image.current = { ...image.current, img: data };
    }
    return (
        <SafeAreaView style={styles.container}>
            <Header navigation={navigation} title={'Thêm sản phẩm'} />
            <ScrollView>
                <View>
                    <View style={{
                        marginLeft: 10
                    }}>
                        <Image source={{ uri: uri.img }} style={{
                            width: 100,
                            height: 100
                        }} />
                        <TouchableOpacity style={{
                            borderRadius: 5,
                            width: 100,
                            padding: 10,
                            borderColor: Colors.black,
                            borderWidth: 1,
                            alignItems: 'center',
                            justifyContent: 'center'
                        }} onPress={selectImage1}>
                            <Text style={styles.buttonText}>chọn ảnh</Text>
                        </TouchableOpacity>
                    </View>
                    <View style={{ marginHorizontal: 20 }}>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Tên sản phẩm...'}
                                value={product.name}
                                onChangeText={(e) => { setProduct({ ...product, name: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Hãng...'}
                                value={product.firm}
                                onChangeText={(e) => { setProduct({ ...product, firm: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Số lượng...'}
                                maxLength={4}
                                keyboardType={'numeric'}
                                value={product.quantity}
                                onChangeText={(e) => { setProduct({ ...product, quantity: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Đơn giá...'}
                                keyboardType={'numeric'}
                                value={product.price}
                                onChangeText={(e) => { setProduct({ ...product, price: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Màn hình...'}
                                value={product.display}
                                onChangeText={(e) => { setProduct({ ...product, display: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Hệ điều hành...'}
                                value={product.os}
                                onChangeText={(e) => { setProduct({ ...product, os: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Camera trước...'}
                                value={product.cameraT}
                                onChangeText={(e) => { setProduct({ ...product, cameraT: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Camera sau..'}
                                value={product.cameraS}
                                onChangeText={(e) => { setProduct({ ...product, cameraS: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Chip...'}
                                value={product.chip}
                                onChangeText={(e) => { setProduct({ ...product, chip: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'RAM...'}
                                value={product.ram}
                                onChangeText={(e) => { setProduct({ ...product, ram: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Bộ nhớ trong...'}
                                value={product.rom}
                                onChangeText={(e) => { setProduct({ ...product, rom: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'SIM...'}
                                value={product.sim}
                                onChangeText={(e) => { setProduct({ ...product, sim: e }) }}
                            />
                        </View>
                        <View style={styles.input}>
                            <TextInput
                                placeholder={'Pin, Sạc...'}
                                value={product.pin}
                                onChangeText={(e) => { setProduct({ ...product, pin: e }) }}
                            />
                        </View>
                    </View>
                </View>
            </ScrollView>
            <View style={{ marginHorizontal: 20, marginVertical: 20 }}>
                <ButtonContrl
                    title={'Lưu'}
                    color={Colors.white}
                    onPress={() => { createPr() }} />
            </View>
        </SafeAreaView>
    );
};